  constructor(props) {
    super(props);
    this.teste = this.teste.bind(this);
  }


  render() {
    return(
      <header>
        <h1>Set your Country, state and city to show your weather in real time!</h1>
        <form>
          <input
            type="text"
            name="contry"
            onChange={this.teste } />
          <button type="button" className="submitWeather">
            Show me Weather
          </button>
        </form>
      </header>
    )
  }
}

export default Header;
